import React from "react";
import { Link } from "react-router-dom";
export default function Header() {
  return (
    <ul>
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/about">About</Link>
      </li>
      <li>
        <Link to="/feature">Feature</Link>
      </li>
      <li>
        <Link to="/installation">installation</Link>
      </li>
    </ul>
  );
}
